import React from "react"
import {Home} from '@src/components/home/Home'
import {withTranslation} from "../i18n"
import {fetchCategories} from "@src/redux/thunks/categoriesThunk";
import {useDispatch} from "react-redux";


const HomePage = (props) => {
    return (
        <Home {...props} />
    )
};

HomePage.getStaticProps = async () => {
    useDispatch()(fetchCategories('ru'));
    return {namespacesRequired: ['main', 'common']};
};

export default withTranslation(['main', 'common'])(HomePage);
